-- Procedure structure for order_detail
-- ----------------------------
DROP PROCEDURE IF EXISTS `order_detail`;
delimiter ;;
CREATE PROCEDURE `appdb`.`order_detail`(in order_id int)
BEGIN

SELECT BUYERID, OWNERID, PRODUCTID INTO
@buyer_id, @owner_id, @product_id
FROM `order` WHERE ORDERID = order_id;

select * FROM `order` where ORDERID = order_id;
SELECT * FROM user WHERE USERID = @buyer_id;
SELECT * FROM user WHERE USERID = @owner_id;
SELECT * FROM product WHERE PRODUCTID = @product_id;

END
;;
